	integer image_file;
	integer input_read_file;
	integer cropped_images_file;

	// Sequentially read in image data
	always_ff @(posedge ap_clk) begin
		if (~ap_rst_n) begin
			img_idx <= 0;
		end	
		else if (crop_layer_input_V_data_0_V_TVALID & crop_layer_input_V_data_0_V_TREADY) begin
			img_idx <= img_idx + 1;
			crop_layer_input_V_data_0_V_TDATA <= image_data[img_idx];
			$fwrite(input_read_file, "%b\n", crop_layer_input_V_data_0_V_TDATA);
		end	
	end
	
	// Sequentially read out cropped-image data
	always_ff @(posedge ap_clk) begin
		if (layer11_out_V_data_0_V_TVALID & layer11_out_V_data_0_V_TREADY) begin
			$fwrite(cropped_images_file, "%b\n", layer11_out_V_data_0_V_TDATA);
